import React from "react";
import UserForm from "./UserForm/UserForm";
import './App.css';

function App() {

  function addUserHandler(username, age){
    console.log(username + " : " + age);
  }

  return (
    <div>
      <section id="user-form">
        <UserForm onAddUser={addUserHandler} />
      </section>
      <section id="users"></section>
    </div>
  );
}

export default App;
